import React from 'react';
import styles from './PhoneBanner.module.css';

const PhoneBanner = () => {
  return (
    <div className={styles.banner}>
      <div className={styles.mainBanner}>
        <img src="/images/phone-banner.jpg" alt="Phone Promotions" />
      </div>
      <div className={styles.subBanners}>
        <div className={styles.subBanner}>
          <img src="/images/sub-banner-1.jpg" alt="Special Offer 1" />
        </div>
        <div className={styles.subBanner}>
          <img src="/images/sub-banner-2.jpg" alt="Special Offer 2" />
        </div>
      </div>
    </div>
  );
};

export default PhoneBanner;
